  `,ct=[{label:"名称",text:"金子 千夏（かねこ ちなつ）"},{label:"製造日",text:"1998年8月25日"},{label:"使用ツール",text:"Ilustrator / Photoshop / Figma / Visual Studio Code / Dreamweaver"},{label:"使用言語",text:"HTML / CSS / PHP / Javascript"},{label:"使用上の注意",text:"業務に慣れるまでは質問が多くなる傾向があります。"},{label:"好物",text:"コーヒー / 音楽 / イラスト / 展示 / ちいかわ"},{label:"概要",text:"デザインとプログラミング両方のスキルを活かした作品作りを目標に、業務や自主制作に励んでいます。職場環境が良いことが一番！だと考えているので積極的に人の考えを汲んだり、業務で役立ちそうなスキルを身に着けるようにしています。"}],K=[[{title:"How was today?（日記画像メーカー）",comment:"ブラウザで文字の入力・グラデーションの調整ができる日記画像メーカー",thumbnail:ay,img:sy},{label:"制作目的",text:"今日感じたことや考えたことをビジュアルとして残せるツールを作りたい"},{label:"概要",text:"ブラウザで文字の入力・グラデーションの調整ができる日記画像メーカーを制作中です。自動で現在の日付を取得・表示して、「今日」の日記としてダウンロードできるようになっています。特にグラデーション編集画面で色選択の結果がすぐに反映するのが視覚的に面白いのでお気に入りのポイントです。元々Reactの習作として最低限の機能を作成しましたが、もっとカスタマイズ性を高めたり世界観を練るなどしたいので今後も開発を続けていきます。",link:"コードを見る ＞",path:"https://github.com/knk-summer/how-was-today.git"},{label:"作業工程",text:"要件定義 / 基本設計 / 詳細設計 / 実装"},{label:"使用ツール",text:"Figma / Visual Studio Code"},{label:"使用言語・フレームワーク",text:"HTML / Javascript / React / CSS / Emotionライブラリ"}],[{title:"RandomViewer",comment:"選択したフォルダ内の画像をランダム表示するビューワー",thumbnail:ey,img:ry},{label:"制作目的",text:"埋もれていく画像が勿体ないので「好きなもの」画像フォルダを満遍なく閲覧したい"},{label:"概要",text:"選択したフォルダ内の画像をランダム表示するビューワーを作成しました。機能はシンプルですが、表示画像クリックで別窓表示・ライト/ダークモード切替などじっくり鑑賞したい人に優しい作りを心掛けました。他の人も触れる状態の作品を作りたい！という想いから始まり、初めてPythonを勉強し2週間ほどでwindowsアプリとして形にすることができました。実際に友人や先輩にテストしてもらって、フィードバックもいただけたのでとても良い経験になりました。",link:"コードを見る ＞",path:"https://github.com/knk-summer/random_viewer.git"},{label:"作業工程",text:"要件定義 / 基本設計 / 詳細設計 / 実装 / テスト設計 / テスト実施 "},{label:"使用ツール",text:"Visual Studio Code"},{label:"使用言語・フレームワーク",text:"Python"}],[{title:"じぶんステッカー",comment:"自分の属性や好きな物をステッカーとして配置できる名札画像メーカー",thumbnail:ly,img:fy},{label:"制作目的",text:"自主制作発表会がオフラインになったので、オフライン交流ならではのツールを作成したかった"},{label:"概要",text:"「自分ってこういう人です！」をポップなビジュアルで伝えられる名札画像メーカー「じぶんステッカー」を制作しました。属性を選択することでそれに応じたステッカーが貼られた名札画像を作成・ダウンロードすることができます。デザイン・イラスト・プログラミングという自分のできることを掛け合わせた作品作りを目標に、社内の自主制作発表会に向けて制作しました。ローカルで動作するところまで制作したのですが、UIや機能含めいつかリメイクしたいと思っているので現在はコードのみ公開とさせていただいています。",link:"コードを見る ＞",path:"https://github.com/knk-summer/myself_sticker.git"},{label:"作業工程",text:"要件定義 / 基本設計 / 詳細設計 / 実装"},{label:"使用ツール",text:"Illustrator / Photoshop / Visual Studio Code / Figma"},{label:"使用言語・フレームワーク",text:"HTML / CSS / PHP / Laravel"}],[{title:"架空の和風カフェ「寛茶」のWebサイト",comment:"架空のカフェのコンセプトからWebサイト実装まで一貫して制作",thumbnail:Pv,img:cy},{label:"コンセプト",text:"抹茶をもっと手軽に、日常の一部に"},{label:"ターゲット",text:"20代後半～のお茶やカフェが好きな方"},{label:"概要",text:"日本の伝統的なお茶を街中でも気軽に味わえるカフェ「寛茶」を題材にWebサイトを制作しました。こちらはカフェの実在性を高めるためにメニューや場所まで設定を細かく練りました。サイトはPC版のファーストビューを動画にすることで「美味しそう」「尾心地が良さそう」という印象やカフェの世界観がすぐに伝わるようにしています。またメニューをカルーセルにしたり背景の切り替えに視差効果を使用したりと、世界観を保ちつつ飽きさせないような動きを取り入れました。",link:"サイトを見る ＞",path:"/kancha/kancha.html"},{label:"作業工程",text:"デザイン / コーディング"},{label:"使用ツール",text:"Illustrator / Photoshop / Visual Studio Code"}],[{title:"2022年制作ポートフォリオサイト",comment:"転職活動のために制作したポートフォリオサイト",thumbnail:ty,img:iy},{label:"コンセプト",text:"自分の大切にしていること、作品の傾向を伝える"},{label:"ターゲット",text:"応募した企業の採用担当、社員の方々"},{label:"概要",text:"転職活動時に使用したポートフォリオサイトです。ブランク期間が長い中の応募だったので、スキルよりも人柄などで「一緒に働きたい」と思ってもらえるかが重要だと考え制作しました。そこで自分の働き方のスタンスをRPGの勇者パーティをモチーフにイラストにすることで、キャッチーかつ印象に残りやすくしました。全体的には閲覧のノイズにならないような心地よい動き・余白の取り方を意識してシンプルにまとめています。",link:"サイトを見る ＞",path:"/portforio/index.html"},{label:"作業工程",text:"デザイン / コーディング"},{label:"使用ツール",text:"Illustrator / Photoshop / Visual Studio Code"}],[{title:"卒業進級制作展ポスター",comment:"自身の卒業年度に担当した卒展ポスターデザイン",thumbnail:Iv,img:ny},{label:"コンセプト",text:"こころ、はずむ瞬間を！（卒展テーマ「signal」からクラッカーモチーフに）"},{label:"ターゲット",text:"山デザ（母校）や卒展に興味のある方"},{label:"概要",text:"平成31年度の卒展のポスターのデザインを担当しました。一つの課題に対して各々が個性を持ってアイディアを発信している様子をクラッカーをモチーフに構成しています。キャッチコピーはクラッカーの瞬間的な衝撃と、良い作品に出会った時の高揚感を掛け合わせた言葉になっています。母校の面白さは人によって得意分野が違い多彩な答えが返ってくるところなので、様々な画材やテイストを組み合わせることでそれぞれの個性を表現しました。"},{label:"作業工程",text:"デザイン"},{label:"使用ツール",text:"Illustrator / Photoshop"}],[{title:"農畜産物フェスティバルポスター",comment:"学内コンペにて採用された山形市農畜産物フェスティバルのポスターデザイン",thumbnail:Fv,img:uy},{label:"コンセプト",text:"色めく（華やかになる/活気づく）。"},{label:"ターゲット",text:"今まで当イベントに来たことのない山形県民。"},{label:"概要",text:"専門学校在学中に採用されたポスターです。「色めく」をテーマに、木々や農畜産物の色味の鮮やかさを意識して仕上げました。また、多種多様な生産物が積み上がったビジュアルにすることでお祭りのような雰囲気を演出し、若い人でも気軽に参加できるようにしています。ブースの情報については、お客様に全てのブースを周って楽しんで欲しいと感じたため、スタンプラリーのイメージではんこ風のアイコンを配置しています。イラストが特に好評だったようで、ポスターデザインが変わっても何年かは看板やのぼりのデザインに使用されていました。"},{label:"作業工程",text:"デザイン / イラスト"},{label:"使用ツール",text:"Illustrator / Photoshop"}]],[w,P]=Qt.useState(!1),[tt,nt]=Qt.useState(!1);let L=null;function xt(){const At=Tt`
